INSERT INTO `field_data_field_agent_about` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_agent_about_value`, `field_agent_about_summary`, `field_agent_about_format`) VALUES
('profile2', 'agent', 0, 3, 3, 'und', 0, '<p>John Doe, the founding partner of Elegran, started the company in 2007 in a unique way. He did this without coming from another Manhattan firm. The instinct that drove him to form Elegran was a strong vision and passion to create a workplace atmosphere of generosity and teamwork. Similarly, he committed himself to a basis where the people would be more important than the company’s bottom line. His penchant for providing exceptional service to his clients coupled with a cutting-edge knowledge of the industry has provided Elegran’s agents with a strong foundation to succeed in their own goals of making clients’ real estate dreams into reality.</p>\r\n<p>Moreover, Doe realized that there was a real demand for a non-pressured, honest atmosphere where agents could thrive without the everyday workplace politics. Doe also envisioned a workplace in which people would feel at home, clients’ interests would be put first and innovative strategies using technology would be utilized in servicing clients’ and agents’ needs. We believe that this ongoing mission combined with a commitment to industry ethics, selflessness and our select team of knowledgeable agents can change the real estate industry for the better.</p>\r\n<p>Prior to Elegran, Doe gained his industry experience in wholesale mortgage banking. He quickly rose to the top of his field at the age of 27, producing in the top 1% industrywide. Close to his exit from that field, Doe was known for implementing new underwriting methods, which brought his team to be the most profitable in the Northeast.</p>\r\n<p>Today, Doe and the Elegran team have made their mark; they have earned a respectable presence in the most competitive Real Estate market in the world. His team has experienced exponential growth from the formative days, and they continue to succeed. Agents who work at Elegran continually boast about the office and our “family” atmosphere.</p>\r\n<p>Residing for over a decade in the NYC area and a native of Williamsville, New York, Doe went to college in upstate New York, the University of Hawaii and The London School of Economics, majoring in both Business and Economics. Doe spends most of his free time with his family and enjoys reading, travel, music and sporting events.</p>', 'Michael Feng is a real estate agent, but his true goal is to be a resource for his clients. Since 2006,...', 'filtered_html'),
