 in the NYC area and a native of Williamsville, New York, Doe went to college in upstate New York, the University of Hawaii and The London School of Economics, majoring in both Business and Economics. Doe spends most of his free time with his family and enjoys reading, travel, music and sporting events.</p>', 'John Doe, the founding partner of Elegran, started the company in 2007 in a unique way. He did this without...', 'full_html');
