(42, 13, 'left', 'custom', 'custom', 1, 'a:0:{}', 'a:5:{s:11:"admin_title";s:9:"Accordion";s:5:"title";s:0:"";s:4:"body";s:4498:"<div class="noo-text-block">\n                    <h3 class="text-primary">ACCORDION</h3>\n                    <p>Accordion are flexible and easy to use. It will be perfect to manage huge amount of content and bring a neat look. With Accordion shortcode, you can create as many accordions as you want, choose different icons and set active accordion when loading page. You can collapse all accordions at loading page by setting value -1 for active-tab.</p>\n                  </div>\n                  <div id="noo-accordion-1" data-active-tab="0" class="noo-vc-accordion panel-group  icon-dark_circle">\n                    <div class="panel panel-default">\n                      <div class="panel-heading active">\n                        <h4 class="panel-title">\n                          <a data-toggle="collapse" class="accordion-toggle" href="#noo-accordion-tab-2" data-parent="#noo-accordion-1">\n                            <span>About Accordions</span>\n                          </a>\n                        </h4>\n                      </div>\n                      <div id="noo-accordion-tab-2" class="noo-accordion-tab panel-collapse collapse in">\n                        <div class="panel-body">\n                          <div class="noo-text-block">\n                            <p>I am text block. Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec ullamcorper mattis, pulvinar dapibus leo.</p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                    <div class="panel panel-default">\n                      <div class="panel-heading">\n                        <h4 class="panel-title">\n                          <a data-toggle="collapse" class="accordion-toggle" href="#noo-accordion-tab-3" data-parent="#noo-accordion-1">\n                            <span>Active Accordions</span>\n                          </a>\n                        </h4>\n                      </div>\n                      <div id="noo-accordion-tab-3" class="noo-accordion-tab panel-collapse collapse">\n                        <div class="panel-body">\n                          <div class="noo-text-block">\n                            <p>I’m an active accordion after you opened to read. Click [-] to have this content hidden.</p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                    <div class="panel panel-default">\n                      <div class="panel-heading">\n                        <h4 class="panel-title">\n                          <a data-toggle="collapse" class="accordion-toggle" href="#noo-accordion-tab-4" data-parent="#noo-accordion-1">\n                            <span>Not only Text</span>\n                          </a>\n                        </h4>\n                      </div>\n                      <div id="noo-accordion-tab-4" class="noo-accordion-tab panel-collapse collapse">\n                        <div class="panel-body">\n                          <div class="noo-text-block">\n                            <p>You can add many more thing into this content. Such as below image</p>\n                          </div>\n                          <img src="http://html.nootheme.com/citilights/images/other/accordion-img1.jpg" alt="" class="noo-image">\n                          <p></p>\n                        </div>\n                      </div>\n                    </div>\n                    <div class="panel panel-default">\n                      <div class="panel-heading">\n                        <h4 class="panel-title">\n                          <a data-toggle="collapse" class="accordion-toggle" href="#noo-accordion-tab-5" data-parent="#noo-accordion-1">\n           